// src/MainApp.js

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

/* Подключаем глобальный фон-градиент и глобальные стили (Montserrat, сбросы) */
import './Styles/global.css';
import './Styles/background.css';

import WelcomePage     from './WelcomePage';
import MainMenu        from './MainMenu';
import PollsPage       from './PollsPage';
import SNPPage         from './SNPPage';
import EmployeePage    from './EmployeePage';
import AssessmentPage  from './AssessmentPage';
import FeedbackPage    from './FeedbackPage';
import JustincasePage  from './JustincasePage';
import CareFuturePage  from './CareFuturePage';
import MarzaPollPage   from './MarzaPollPage';
import ThankYouPage    from './ThankYouPage';

import piImage from './components/pi.png';

function PiIcon() {
  // Чтобы «π» не перерисовывался на каждом рендере,
  // храним move/rotate duration в useState и вычисляем один раз:
  const [moveDuration, setMoveDuration]     = useState('70s');
  const [rotateDuration, setRotateDuration] = useState('6s');

  useEffect(() => {
    // Генерируем случайные длительности для анимации «π»
    const rndMove = Math.random() * (90 - 50) + 50;   // от 50s до 90s
    const rndRot  = Math.random() * (8 - 4)  + 4;    // от 4s до 8s

    setMoveDuration(`${rndMove.toFixed(2)}s`);
    setRotateDuration(`${rndRot.toFixed(2)}s`);
  }, []);

  return (
    <div
      className="pi-wrapper pi-active"
      style={{ '--pi-move-duration': moveDuration }}
    >
      <img
        src={piImage}
        alt="Pi"
        className="pi-fly"
        style={{ '--pi-rotate-duration': rotateDuration }}
      />
    </div>
  );
}

function MainApp() {
  return (
    <div className="app-container">
      {/* Едва заметные «точки» (subtle-dot) для фоновой динамики */}
      <div className="subtle-dot dot-1" />
      <div className="subtle-dot dot-2" />
      <div className="subtle-dot dot-3" />
      <div className="subtle-dot dot-4" />

      {/* Иконка «π» рендерится один раз и остаётся на экране при навигации */}
      <PiIcon />

      <Router>
        <Routes>
          <Route path="/"           element={<WelcomePage />} />
          <Route path="/main-menu"  element={<MainMenu />}   />
          <Route path="/polls"      element={<PollsPage />}  />
          <Route path="/snp"        element={<SNPPage />}    />
          <Route path="/employee"   element={<EmployeePage />} />
          <Route path="/assessment" element={<AssessmentPage />} />
          <Route path="/feedback"   element={<FeedbackPage />}   />
          <Route path="/justincase" element={<JustincasePage />} />
          <Route path="/carefuture" element={<CareFuturePage />} />
          <Route path="/marzapoll"  element={<MarzaPollPage />} />
          <Route path="/thankyou"   element={<ThankYouPage />}   />
        </Routes>
      </Router>
    </div>
  );
}

export default MainApp;
